attribute vec4 inPosition; 
attribute vec2 inTexCoord0; 
attribute vec3 inColor; 

uniform float polyAlpha; 
uniform vec2 texScale; 

varying vec4 vtxPosition; 
varying vec2 vtxTexCoord; 
varying vec4 vtxColor; 

void main() 
{ 
	mat2 texScaleMtx	= mat2(	vec2(texScale.x,        0.0), 
								vec2(       0.0, texScale.y)); 

	vtxPosition = inPosition; 
	vtxTexCoord = texScaleMtx * inTexCoord0; 
	vtxColor = vec4(inColor * 4.0, polyAlpha); 

	gl_Position = vtxPosition; 
}

precision mediump float; 
varying vec4 vtxPosition; 
varying vec2 vtxTexCoord; 
varying vec4 vtxColor; 

uniform sampler2D texMainRender; 
uniform sampler2D texToonTable; 
uniform int polyID; 
uniform bool hasTexture; 
uniform int polygonMode; 
uniform int toonShadingMode; 
uniform int oglWBuffer; 
uniform bool enableAlphaTest; 
uniform float alphaTestRef; 

void main() 
{ 
	vec4 texColor = vec4(1.0, 1.0, 1.0, 1.0); 
	vec4 fragColor; 

	if(hasTexture) 
	{ 
		texColor = texture2D(texMainRender, vtxTexCoord); 
	} 

	fragColor = texColor; 

	if(polygonMode == 0) 
	{ 
		fragColor = vtxColor * texColor; 
	} 
	else if(polygonMode == 1) 
	{ 
		if (texColor.a == 0.0 || !hasTexture) 
		{ 
			fragColor.rgb = vtxColor.rgb; 
		} 
		else if (texColor.a == 1.0) 
		{ 
			fragColor.rgb = texColor.rgb; 
		} 
		else 
		{ 
			fragColor.rgb = texColor.rgb * (1.0-texColor.a) + vtxColor.rgb * texColor.a;
		} 

		fragColor.a = vtxColor.a; 
	} 
	else if(polygonMode == 2) 
	{ 
		if (toonShadingMode == 0) 
		{ 
			vec3 toonColor = vec3(texture2D(texToonTable, vec2(vtxColor.r,0)).rgb); 
			fragColor.rgb = texColor.rgb * toonColor.rgb;
			fragColor.a = texColor.a * vtxColor.a;
		} 
		else 
		{ 
			vec3 toonColor = vec3(texture2D(texToonTable, vec2(vtxColor.r,0)).rgb); 
			fragColor.rgb = texColor.rgb * vtxColor.rgb + toonColor.rgb; 
			fragColor.a = texColor.a * vtxColor.a; 
		} 
	} 
	else if(polygonMode == 3) 
	{ 
		if (polyID != 0) 
		{ 
			fragColor = vtxColor; 
		} 
	} 

	if (fragColor.a == 0.0 || (enableAlphaTest && fragColor.a < alphaTestRef)) 
	{ 
		discard; 
	} 

	gl_FragColor = fragColor; 
}
